import React from 'react';
import '../../test.css';

const ListItems=()=>{
    const arr = [{data: 'Data 1', id: 1}, 
                 {data: 'Data 2', id: 2}]

    const data = arr.map(({data, id}) => {
        return  <li className='hello' key={id}>{data}</li>
    })

    return(
        <div>
            {data}
        </div>
    )
};

export default ListItems;
